export const obtenerAsuntos = async() => {
    const response = await fetch("http://api.tvmaze.com/shows/431/episodes", {
        'mode': 'opaque',
        'headers': {
            'Access-Control-Allow-Origin': '*',
        }
    });
    const data = await response.json();
    return data;
}
